import {createStore} from "redux";


const initialState = {
        List: []
};


const store = createStore(cartReduer, initialState, window.__REDUX_DEVTOOLS_EXTENSION__ && window.__REDUX_DEVTOOLS_EXTENSION__());

export default store;
